import React from 'react'
import { useState } from 'react'

export default function Hint(usedHint) {
    

  const [usehint, setHint] = useState(false)
  
  function t()
  {
    if(usehint === true)
    {
      document.getElementById('hintbut').style.pointerEvents = 'none'
    }
  }

  return (
    <div id='hintbut' className='hint' onClick={setHint(true)}></div>
  )
}
